import React from 'react';
import { withStyles } from '@material-ui/core';
const styles = {
  sideMenu: {
    display: 'flex',
    flexDirection: 'column',
    position: 'absolute',
    left: 'pc',

    height: ' 100%',
    background: '#2b3053',
  },
};
const SideMenu = (props) => {
  const { classes } = props;

  return <div className={classes.sideMenu}></div>;
};

export default withStyles(styles)(SideMenu);
